import React from 'react'

function WaveDisplay() {
  return (
    <div className='WaveDisplay'>
      This is wave
    </div>
  )
}
function Controller(){
    return(
        <div className='Controller'>

        </div>
    )
}

export default function ExportView() {
  return (
    <div className='ExportView'>
        <WaveDisplay/>
    </div>
  )
}
